import { FETCH_TICKETS } from './types';
import axios from 'axios';

export const fetchTickets = () => dispatch => {
    axios.get('https://api.npoint.io/163b5e66df9f2741243e')
    .then(tickets => dispatch({
        type: FETCH_TICKETS,
        payload: tickets
        })
    );
}
